import React from "react";
import './Detailview.css';
import sample from "./sample.jpg"
const Detailview = () =>{
    return(
        <div className='detail'>
            <img src={sample}></img>
            <p>대한 맺어, 피고 내는 피다. 그들의 가장 얼마나 뜨고, 일월과 꾸며 별과 사막이다. 우리 청춘의 반짝이는 위하여서 싸인 힘있다. 타오르고 구하지 되려니와, 그것은 현저하게 온갖 원대하고, 웅대한 같지 사막이다. 인류의 넣는 밝은 청춘에서만 보라. 인간의 이상의 살 과실이 그리하였는가? 평화스러운 더운지라 이것은 풍부하게 되려니와, 인도하겠다는 구하기 그러므로 위하여서. 청춘의 넣는 없으면 이상은 커다란 무한한 것이다. 얼마나 찾아다녀도, 갑 그러므로 청춘의 하여도 불어 천하를 것은 말이다.

찾아다녀도, 인간은 긴지라 사막이다. 것은 속잎나고, 싹이 있는 물방아 봄바람이다. 이는 청춘 열락의 이상, 목숨을 꽃이 과실이 피다. 현저하게 얼마나 공자는 있는 봄바람이다. 남는 얼음과 미인을 보라. 풀이 없으면 그들의 속에 없으면, 있으랴? 거친 청춘 이는 청춘은 무엇을 이상의 방지하는 약동하다. 없으면 위하여, 인생을 이상은 날카로우나 얼마나 커다란 우리의 이 부패뿐이다. 동산에는 인생의 산야에 그들에게 얼음과 속에 새가 장식하는 것이다. 뜨고, 그들은 것은 쓸쓸한 따뜻한 가슴에 청춘은 바이며, 위하여 뿐이다. 같이, 같이 되는 굳세게 구하지 것이다.
...</p>
        </div>
    )
}
export default Detailview;
